import React from "react";
import LoginSvg from "../../assets/svg/login";
import LogoSvg from "../../assets/svg/logo";

function DigiHeader() {
  return (
    <div className="headerContainer">
      <div className="">
        <LogoSvg />
      </div>
      <div className="">
        <LoginSvg width="17%" height="100%" color="#2D9596" />
      </div>
    </div>
  );
}

export default DigiHeader;
